import React, { useState } from "react";
import {
  Container,
  Typography,
  TextField,
  Button,
  Card,
  CardContent,
  Grid,
  List,
  ListItem,
  ListItemText,
  Divider,
} from "@mui/material";

function App() {
  const [longUrl, setLongUrl] = useState("");
  const [validity, setValidity] = useState("");
  const [customCode, setCustomCode] = useState("");
  const [shortUrls, setShortUrls] = useState([]);
  const [logs, setLogs] = useState([]);

  // Helper: random short code generator
  const generateCode = () =>
    Math.random().toString(36).substring(2, 7);

  // Create short link
  const handleShorten = () => {
    if (!longUrl.trim()) {
      alert("Please enter a URL");
      return;
    }

    const code = customCode.trim() || generateCode();
    const expiry = validity
      ? new Date(Date.now() + validity * 60000)
      : new Date(Date.now() + 30 * 60000); // default 30 min

    const newUrl = {
      original: longUrl,
      code,
      expiry,
      clicks: 0,
    };

    setShortUrls([...shortUrls, newUrl]);
    setLogs([
      ...logs,
      `Short link created: ${code} for ${longUrl}`,
    ]);

    // reset fields
    setLongUrl("");
    setValidity("");
    setCustomCode("");
  };

  // Simulate visiting short link
  const handleVisit = (urlObj) => {
    if (new Date() > urlObj.expiry) {
      alert("This short link has expired!");
      setLogs([
        ...logs,
        `Expired link attempted: ${urlObj.code}`,
      ]);
      return;
    }

    urlObj.clicks += 1;
    setLogs([
      ...logs,
      `Redirected ${urlObj.code} → ${urlObj.original}`,
    ]);
    window.open(urlObj.original, "_blank");
  };

  return (
    <Container maxWidth="md" style={{ marginTop: "2rem" }}>
      <Typography variant="h4" gutterBottom>
        Afford Med – URL Shortener
      </Typography>

      {/* Input Card */}
      <Card style={{ marginBottom: "2rem" }}>
        <CardContent>
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <TextField
                label="Enter Long URL"
                value={longUrl}
                onChange={(e) => setLongUrl(e.target.value)}
                fullWidth
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                label="Validity (minutes)"
                value={validity}
                onChange={(e) => setValidity(e.target.value)}
                type="number"
                fullWidth
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                label="Custom Code (optional)"
                value={customCode}
                onChange={(e) => setCustomCode(e.target.value)}
                fullWidth
              />
            </Grid>
            <Grid item xs={12}>
              <Button
                variant="contained"
                color="primary"
                onClick={handleShorten}
              >
                Generate Short Link
              </Button>
            </Grid>
          </Grid>
        </CardContent>
      </Card>

      {/* Short Links List */}
      <Typography variant="h6">Your Short Links</Typography>
      <List>
        {shortUrls.map((url, idx) => (
          <React.Fragment key={idx}>
            <ListItem>
              <ListItemText
                primary={`Short: ${url.code} → ${url.original}`}
                secondary={`Expires: ${url.expiry.toLocaleString()} | Clicks: ${url.clicks}`}
              />
              <Button
                size="small"
                variant="outlined"
                onClick={() => handleVisit(url)}
              >
                Visit
              </Button>
            </ListItem>
            <Divider />
          </React.Fragment>
        ))}
      </List>

      {/* Logs */}
      <Typography variant="h6" style={{ marginTop: "2rem" }}>
        Activity Logs
      </Typography>
      <List>
        {logs.map((log, i) => (
          <ListItem key={i}>
            <ListItemText primary={log} />
          </ListItem>
        ))}
      </List>
    </Container>
  );
}

export default App;
